import "./Body.css";
import PageAboutMe from "./PageAboutMe";
import PageCharacterList from "./PageCharacterList";
import PageToDo from "./PageToDo";
import PageContact from "./PageContact";

const Body = (props) => {
  const name = "Name Surname";
  const cv =
    "Lorem Ipsum is simply dummy text of the printing. Lorem Ipsum has been the industrys standard dummy text when an unknown printer took a galley of type specimen book. It has survived not essentially unchanged. It was popularised in the 1960s release of Letraset sheets containing Lorem Ipsum passages, recently with desktop publishing software like Aldus versions of Lorem Ipsum. Why do we use it? It is a fact that a reader will be distracted by the of a page when looking at its layout. The point of using Various versions have evolved over the by accident, sometimes on purpose (injected humour and";

  return (
    <div>
      <PageAboutMe image={image} name={name} cv={cv} />
      <PageCharacterList />
      <PageToDo />
      <PageContact />
    </div>
  );
};

export default Body;
